import React from "react";
import StarRatingComponent from 'react-star-rating-component';


const Search=({getRate,getWord,rate} )=>{
    const  onStarClick=(nextValue ) =>{
        getRate( nextValue);
      }
    return(
<div>
 
<div className="btn-search">
<input type="text" placeholder="Enter Movie Name" className="inputtext" onChange={(e)=>getWord(e.target.value)}></input>


<StarRatingComponent 
          name="rate1" 
          starCount={5}
          value={rate}
          onStarClick={onStarClick}
        />
</div>
</div>
    )
}
export default Search;
